  "title": "What comics did Alan Grant write? Scottish comic book writer dies at 73",
  "link": "https://www.hitc.com/en-gb/2022/07/21/alan-grant-comics/?utm_source=rss&utm_medium=rss&utm_campaign=alan-grant-comics",
